import { useEffect, useState } from "react";
import "./App.css";

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:5000/api/data")
      .then(res => res.json())
      .then(data => setData(data))
      .catch(err => console.error(err));
  }, []);

  return (
    <div className="container">
      <h2>Crop Market Prices</h2>

      <table>
        <thead>
          <tr>
            <th>Commodity</th>
            <th>Market</th>
            <th>Modal Price</th>
            <th>State</th>
          </tr>
        </thead>

        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.Commodity}</td>
              <td>{item.Market}</td>
              <td>â‚¹{item.Modal_x0020_Price}</td>
              <td>{item.State}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
